int floor = 0;

int i = 0;
while (i < input.Length)
{
  char c = input[i];
  Console.WriteLine(i + ": " + c);
  if (c == '(')
  {
    floor = floor + 1;
  }
  else
  {
    floor = floor - 1;
    if (floor < 0)
    {
      break;
    }
  }
  i++;
}

